import React from "react";
import Link from "next/link";
import { Menu, Input } from "antd";
const AppLayout = ({ children }) => {
  return (
    <div>
      <Menu mode="horizontal">
        <Menu.Item key={"ntc"}>
          <Link href="/">
            <a>HOME</a>
          </Link>
        </Menu.Item>
        <Menu.Item key={"edoc"}>
          <Link href="/edocument/edocMain" as="/edoc">
            <a>전자문서</a>
          </Link>
        </Menu.Item>
      </Menu>
      {children}
    </div>
  );
};

export default AppLayout;
